import React, { useState, useEffect } from "react";
import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import { useNavigate } from "react-router-dom";
import "../../css/style.css";
import { ToastContainer, toast } from "react-toastify";
import DataTable from "react-data-table-component";
import ArrowUpwardIcon from "@mui/icons-material/ArrowUpward";
import swal from "sweetalert";
import { useForm } from "react-hook-form";
import { Dropdown } from "react-bootstrap";

const axios = require("axios");
toast.configure();

function Users() {
  const token = localStorage.getItem("token");
  // console.log(token);
  // Featch All Data
  const [allData, setallData] = useState([]);

  useEffect(() => {
    callData();
  }, []);

  function callData() {

    axios.get(process.env.REACT_APP_API_URL + "/user/getAlldata",{headers: {Token: token}}).then((response) => 
    {
         for (let index = 0; index < response.data.length; index++) {
          response.data[index].id = index+1;
         }
        setallData(response.data);
   });

  }


  window.addEventListener("ready", (event) => {
    callData();
  });

  //  Delete PlayList
  const onDelete = (val) => {
    swal({
      title: "Are you sure?",
      text: "Once deleted, you will not be able to recover this imaginary file!",
      icon: "warning",
      buttons: true,
      dangerMode: true,
    }).then((willDelete) => {
      if (willDelete) {
        axios
          .post(process.env.REACT_APP_API_URL + "/user/delete", { id: val })
          .then((res) => {
            toast.success("Delete Successfully", {});
            callData();
          })
          .catch((err) => {
            if (
              err.response &&
              err.response.data &&
              err.response.data.errorMessage
            ) {
              toast.error(err.response.data.errorMessage, {});
            }
          });
      }
    });
  };
  //End Delete users

  const columns = [
    {
      id: 1,
      name: "S.no",
      selector: (row) => row.id,
      sortable: true,
      reorder: true,
    },
    {
      id: 2,
      name: "Email / Phone",
      selector: (row) => row.email,
      sortable: true,
      reorder: true,
    },
    {
      id: 3,
      name: "Username",
      selector: (row) => row.username,
      sortable: true,
      reorder: true,
    },

    {
      id: 4,
      name: "User Type",
      selector: (row) => (row.role == 1 ? "Admin" : "User"),
      sortable: true,
      right: true,
      reorder: true,
    },
    {
      id: 5,
      name: "",
      // selector: (row) => row.role,
      sortable: true,
      right: true,
      reorder: true,
    },
    {
      id: 6,
      name: "Action",
      button: true,
      cell: (row) => (
        <React.Fragment>
          <button
            className="btn btn-sm btn-light"
            onClick={() => onDelete(row._id)}
          >
            <i className="bx bx-trash me-0"></i>
          </button>
          &nbsp;
          <Dropdown id="drop">
            <Dropdown.Toggle variant="btn-light btn btn-sm" id="dropdown-basic" style={{color:'#fff'}}>
              {/* <i className="lni lni-more me-0"></i> */}
            </Dropdown.Toggle>

            <Dropdown.Menu>
              <Dropdown.Item
                onClick={() => {
                  setEmail(row.email);
                  setUserName(row.username);
                  setRole(row.role);
                  setUpdateId(row._id);
                  handlePasswordModelShow("changePassword");
                }}
              >
                Change Password
              </Dropdown.Item>
              <Dropdown.Item onClick={() => {
                  setUpdateId(row._id);
                  verifyUser(row._id);
                }}>{row.status == 1 ? 'Verified' : 'Verify User'}</Dropdown.Item>
              {/* <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>  */}
            </Dropdown.Menu>
          </Dropdown>
        </React.Fragment>
      ),
    },
    {
      id: 6,
      name: "",
      // selector: (row) => row.role,
      sortable: true,
      right: true,
      reorder: true,
    },
  ];












  return (
    <>
      <div className="col">
        <br />
        <br />
        <div className="card p-3" style={{ overflow: "auto" }}>
          <DataTable
            style={{ background: "transparent" }}
            title="User"
            columns={columns}
            data={allData}
            defaultSortFieldId={1}
            sortIcon={<ArrowUpwardIcon />}
            pagination
          />
        </div>
      </div>
      {/* Add Data Model */}



    </>
  );
}

export default Users;
